import React from 'react';


function CoinFinalLevelBlock(props) {
    
    return(

            <div 
                className= {props.classname}
            >    
                <span
                    className={props.classnameFinalCoin}
                    style={`color: ${props.coin[0]}`}
                >
                    {props.coin[0]}
                </span>
            </div>

    )
}

export default CoinFinalLevelBlock
